import React, { useState, useEffect } from 'react';

const Post = (props) => {
    const[id, setId] = useState(null);
    useEffect(() => {
        let id = props.match.params.post_id;
        setId(id);
    }, []);
    return (
        <div className="container">
            <h4>route param</h4>
        </div>
    )
}

export default Post;
